import React from 'react'
import { ContainerPrincial, ContainerInput, ContainerTitle } from './styled'
import { Button } from '@material-ui/core'
import useForm from '../../hooks/useForm'

const LoginPage = () => {

    const [form, onChange, clear] = useForm({email: "", password: ""})

    const onSubmitForm = () => {

    }

    return (
        <div>

        <ContainerTitle>
            <h1>Filmes, séries e muito mais. Sem limites.</h1> 
            <p>Assista onde quiser. Cancele quando quiser.</p>
        </ContainerTitle>
        
        <ContainerPrincial>

            <h1>Faça login</h1>

            <ContainerInput>
                <form onSubmit={onSubmitForm}>
                    <input 
                    placeholder="E-mail"
                    name={"email"}
                    value={form.email}
                    onChange={onChange}
                    required
                    type={"email"}
                    />

                    <input 
                        placeholder="Senha"
                        name={"password"}
                        value={form.password}
                        onChange={onChange} 
                        required
                        type={"password"}
                    />

                    <Button 
                        variant="text" 
                        color="primary">
                        Cadastre-se
                    </Button>  

                    <Button 
                        type={"submit"}
                        variant="contained" 
                        color="primary">
                        Entrar
                    </Button>
                </form>
            </ContainerInput>


 

        </ContainerPrincial>
        </div>
    )
}

export default LoginPage
